Deze grafiek toont het percentage deelnemers aan Infectieradar met klachten die passen bij een acute luchtweginfectie.

* Deelnemers worden meegeteld als zij tenminste één luchtwegklacht doorgeven;
* Deelnemers die meerdere weken luchtwegklachten melden bij de Infectieradar, worden alleen meegeteld in de eerste week;
* Er zijn minder deelnemers in de leeftijdsgroep van 0 tot 24 jaar dan in de andere leeftijdsgroepen. Dat geeft een sterk wisselend beeld bij het bekijken van de resultaten over een langere periode.

Meer informatie over [Infectieradar](https://infectieradar.nl/results)
